import React from "react";
import styled from "styled-components";

export const Container = styled.div`
  min-height: 100vh;
  background-color: #f8f8f8;
  display: flex;
  justify-content: center;
  align-items: center;
`;

export const content = styled.div`
  border-radius: 5px;
`;
